<SUMMARY>
A simplified Fehr-Schmidt model for responder behavior in the Ultimatum Game, capturing aversion to advantageous inequity. The model computes the utility of accepting an offer as the recipient's share reduced by a penalty proportional to the difference between the recipient's and opponent's shares.
</SUMMARY>

